/*Table structure for table `rm_portal_contact_details` */

DROP TABLE IF EXISTS `rm_portal_contact_details`;

CREATE TABLE `rm_portal_contact_details` (
  `contact_id` int(5) NOT NULL AUTO_INCREMENT,
  `full_name` varchar(5000) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `mobile` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `courses_id` int(5) DEFAULT NULL,
  `subject` varchar(1000) DEFAULT NULL,
  `message` varchar(5000) DEFAULT NULL,
  `status` enum('0','1') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '1',
  `rstatus` enum('0','1') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '1',
  `registration_date` date DEFAULT NULL,
  `upload_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `source` enum('0','1','2') DEFAULT '0',
  `ip` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`contact_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;

