CREATE TABLE `rm_user_login_details` (
  `user_id` int(5) NOT NULL AUTO_INCREMENT,
  `full_name` varchar(1000) DEFAULT NULL,
  `password` varchar(5000) DEFAULT NULL,
  `user_type_id` varchar(1000) DEFAULT NULL,
  `email` varchar(1000) DEFAULT NULL,
  `mobile` varchar(100) DEFAULT NULL,
  `module_id_list` varchar(5000) DEFAULT NULL,
  `status` enum('0','1') DEFAULT '0',
  `admin_user_id` int(5) DEFAULT NULL,
  `registration_date` date DEFAULT NULL,
  `upload_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `ip` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;

