/*Table structure for table `rm_user_payment_details` */

DROP TABLE IF EXISTS `rm_user_payment_details`;

CREATE TABLE `rm_user_payment_details` (
  `payment_id` int(5) NOT NULL AUTO_INCREMENT,
  `user_id` int(5) DEFAULT NULL,
  `category_id` int(5) DEFAULT NULL,
  `course_id` int(5) DEFAULT NULL,
  `amount` decimal(10,2) DEFAULT NULL,
  `status` enum('0','1') DEFAULT '1',
  `payment_mode` enum('0','1') DEFAULT '0' COMMENT '0->offline,1->online',
  `short_description` varchar(5000) DEFAULT NULL,
  `payment_date` date DEFAULT NULL,
  `rstatus` enum('0','1') DEFAULT '1',
  `upload_date` datetime DEFAULT NULL,
  `ip` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`payment_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

